import React, { Component } from 'react';

export default class Users extends Component {
  click = (id,e) => {
    console.log(id);
  };

  render() {
    return (
      <div>
        <table className='bg-dark text-white w-75 m-auto mt-5 '>
          <thead className='p-5'>
            <tr>
              <th scope='col'>İD</th>
              <th scope='col'>NAME</th>
              <th scope='col'>LAST-NAME</th>
              <th scope='col'>E-MAİL</th>
            </tr>
          </thead>

          <tbody>
            {this.props.kategori.map(user => (
              <tr key={user.id}>
                <td>{user.id}</td>
                <td>{user.name}</td>
                <td>{user.lastname}</td>
                <td>{user.email}</td>
                <td><button className='btn btn-danger mb-2' onClick={this.click(user.id)}>Delete</button></td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  }
}
